  \"2016-11-25T21:06:17.444604\",\n\t\"name\": \"free-application-for-federal-student-aid-201213\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Free Application for Federal Student
  Aid, 2012-13 (FAFSA 2012-13), is part of the Free Application for Federal Student
  Aid (FAFSA) program; program data is available since 2006-07 at <http://studentaid.ed.gov/about/data-center/student/application-volume>.
  FAFSA 2012-13 (http://studentaid.ed.gov/) is a universe data collection of eligible
  incoming postsecondary education students, along with a subset of eligible continuing
  postsecondary education students, that collects financial information to determine
  the need and eligibility for financial assistance during postsecondary education.
  FAFSA 2012-13 applications are accepted via web and paper submission. Citizen and
  specified noncitizen students demonstrating financial need and planning to attend
  eligible degree or certificate programs in the 50 United States, the District of
  Columbia, Puerto Rico, and the outlying areas as regular students are eligible to
  apply for FAFSA 2012-13. FAFSA 2012-13 resulted in an expected family contribution
  (EFC) for each applying student. Statistics produced from FAFSA 2012-13 include
  application volumes by postsecondary school, state of legal residence, and completion
  by high school; and recipient and volume data by program for each school participating
  in Title IV programs.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
